webpackJsonp([0xae49a5808aaf],{440:function(e,t){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Данное упражнение самое популярное для мышц бицепса. Существует несколько вариаций - может выполняться со штангой (как с прямым, так и с изогнутым грифом) и с гантелями.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Возьмите штангу хватом сверху (ладони обращены вниз) немного шире плеч.\n</li>\n<li>Исходное положение – ноги на ширине плеч, немного согнуты в коленях (10 - 20 градусов) наклонитесь вперед, тело при этом должно быть практически параллельно полу и перпендикулярно бедрам. Держите спину прямой. Штанга должна находиться перед вами на вытянутых руках.</li>\n<li>На выдохе - держа туловище неподвижно, тяните штангу к себе. При этом максимально отводите назад локти и плечи, сведите лопатки. Притянув гриф к поясу, напрягите мышцы спины и на секунду задержитесь в этом положении.</li>\n<li>На вдохе - медленно верните штангу в исходное положение.</li>\n<li>Сделайте необходимое количество повторений.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/94CdlnnnwtQ" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/tyaga-shtangi-v-naklone",efficiency:"7",title:"Тяга штанги в наклоне",image:"/static/2-02-0.jpg",image_2:"",image_3:"",image_4:"",filterby:"back",date:"April 12, 2017",injury:"8",bodypart:"Спина",filtertype:"base",type:"Базовое",filterinventory:"stange",inventory:"Штанга",filterplace:null}}},pathContext:{}}}});
